import styled from "styled-components"

const ToggleInputContainer = styled.div`
    display: flex;
    justify-content: center;
    cursor: pointer;
`

const Input = styled.input`
    position: absolute;
    left: -9999px;

    &:checked + .theme-label::before{
        background-color: rgb(0, 132, 255);
    }
        
    &:checked + .theme-label::after{
        left: 1.6rem;
    }
`

const Label = styled.label`
    display: flex;
    position: relative;
    cursor: pointer;

    &::before, &::after{
        content: "";
        transition: all 0.2s ease;
    }

    &::before{
        display: flex;
        width: 2.8rem;
        height: 1.4rem;
        background-color: rgb(94, 0, 170);
        border-radius: 1rem;
    }

    &::after{
        position: absolute;
        top: 0.2rem;
        left: 0.2rem;
        width: 1rem;
        height: 1rem;
        background-color: #fff;
        border-radius: 100%;
    }
`

function ToggleInput(id){
